import React from 'react';
import { useLocalState } from '../util/useLocalStorage';

const Login = () => {
    const [jwt] = useLocalState("", "jwt");
    
    
    return (
        <div>
            <h1>Login</h1>
            <div>jtw is {jwt}</div>
        </div>
    );
};

export default Login;
